import React from 'react';
// import Dashboard from './component/Dashboard'
import Login from './component/login';
import { BrowserRouter, Route } from 'react-router-dom';
import Signup from './component/Usersignup';
import Dashboard from './component/Dashboad';
import Updateuser from './component/Updateuser';
import Story from './component/Story'



function App() {
  return (
    <>
      <BrowserRouter>
      <Story />
        {/* <Route path="/" exact component={Home} /> */}
        <Route path="/Login" render={(props) => { return (<Login  {...props} />) }} ></Route>
        <Route path="/Signup" render={(props) => { return (<Signup  {...props} />) }} ></Route>
        <Route path="/Dashboard" render={(props) => { return (<Dashboard  {...props} />) }} ></Route>
        <Route path="/Updateuser" render={(props) => { return (<Updateuser  {...props} />) }} ></Route>

      </BrowserRouter>
    </>
  );
}

export default App;
